import React, { Component } from 'react';
import { Button } from 'reactstrap';
import './Input.css';

export const Input = (
    <Button
        tag="a"
        color="danger"
        size="large"
        href="http://reactstrap.github.io"
        target="_blank"
    >
        Import the feed
    </Button>
  );
